["fix this import java.util.ArrayList;

public class ExpressionSolver {
    private ArrayList<String> expressionList;

    public ExpressionSolver(String s) {
        setExpression(s);
    }

    public void setExpression(String s) {
        expressionList = new ArrayList<>();

        for (int i = 0; i < s.length(); i++) {
            expressionList.add(s.substring(i, i + 1));
        }
    }

    public void solveExpression() {
        for (int i = 0; i < expressionList.size()-1; i++) {
            if (expressionList.get(i).equals("*")) {
                expressionList.set(i, " " + (Integer.parseInt(expressionList.get(i - 1)) * Integer.parseInt(expressionList.get(i + 1))));
            } else if (expressionList.get(i).equals("/")) {
                expressionList.set(i, " " + (Integer.parseInt(expressionList.get(i - 1)) / Integer.parseInt(expressionList.get(i + 1))));
            }
            expressionList.remove(i - 1);
            expressionList.remove(i);
            i--;
        }

        for (int i = 0; i < expressionList.size()-1; i++) {
            if (expressionList.get(i).equals("+")) {
                expressionList.set(i, " " + (Integer.parseInt(expressionList.get(i - 1)) + Integer.parseInt(expressionList.get(i + 1))));
            } else if (expressionList.get(i).equals("-")) {
                expressionList.set(i, " " + (Integer.parseInt(expressionList.get(i - 1)) - Integer.parseInt(expressionList.get(i + 1))));
            }
            expressionList.remove(i - 1);
            expressionList.remove(i);
            i--;
        }
    }

    public String toString() {
        return expressionList.get(0);
    }
}
