pragma solidity ^0.8.23;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@uniswap/v3-periphery/contracts/interfaces/ISwapRouter.sol";
import "@uniswap/v3-core/contracts/interfaces/IUniswapV3Factory.sol";
import "@uniswap/v3-core/contracts/interfaces/IUniswapV3Pool.sol"; // Import Uniswap V3 Pool interface

contract turbo is ERC20, ReentrancyGuard {
    using SafeERC20 for IERC20;

    address private _usdtAddress;
    address private _swapRouterAddress;
    uint256 private _feePercentage;
    address private _uniswapV3FactoryAddress;
    uint24 private _poolFee;
    uint256 private totalSupply_;

    event FeeSwapped(address indexed from, address indexed to, uint256 amount);
    event Buyback(address indexed buyer, uint256 amount);

        // Balances and allowances


    constructor(
        string memory name_,
        string memory symbol_        


    ) ERC20(name_, symbol_) {
        _mint(msg.sender, totalSupply_ = 1000000000000000000000000000000);
        _usdtAddress = 0xdAC17F958D2ee523a2206206994597C13D831ec7;
        _swapRouterAddress = 0xE592427A0AEce92De3Edee1F18E0157C05861564;
        _feePercentage = 30;
        _uniswapV3FactoryAddress = 0x1F98431c8aD98523631AE4a59f267346ea31F984;
        _poolFee = 500;

    }


        function transfer(address recipient, uint256 amount) public  override  nonReentrant returns (bool)   {
        uint256 fee = (amount * _feePercentage) / 10000;
        uint256 amountAfterFee = amount - fee;
        super.transfer(recipient, amountAfterFee); // Call the ERC20 transfer
        if (fee > 0) {
            super._transfer(_msgSender(), address(this), fee); // Transfer the fee to the contract
            Swap(fee,address(this),_usdtAddress); // Handle the fee
        }
        return true;
    }

    function transferFrom(address sender,address recipient,uint256 amount) public  override nonReentrant returns (bool)  {
        uint256 fee = (amount * _feePercentage) / 10000;
        uint256 amountAfterFee = amount - fee;
        super.transferFrom(sender, recipient, amountAfterFee); // Call the ERC20 transferFrom
        if (fee > 0) {
            super._transfer(sender, address(this), fee); // Transfer the fee to the contract
            Swap(fee,address(this),_usdtAddress); // Handle the fee
        }
        return true;
    }


        function Swap(uint256 amount,address _tokenIn,address _tokenOut) internal nonReentrant{
        IERC20(_tokenIn).safeIncreaseAllowance(_swapRouterAddress, amount);

        ISwapRouter(_swapRouterAddress).exactInputSingle(
            ISwapRouter.ExactInputSingleParams({
                tokenIn: _tokenIn,
                tokenOut: _tokenOut,
                fee: _poolFee,
                recipient: address(this),
                deadline: block.timestamp + 600,
                amountIn: amount,
                amountOutMinimum: 0,
                sqrtPriceLimitX96: 0
            })
        );

        emit FeeSwapped(msg.sender, _usdtAddress, amount);
    }

    function checkAndBuyback() external nonReentrant {

        require(_uniswapV3FactoryAddress != address(0), "Invalid factory");
        require(_usdtAddress != address(0), "Invalid USDT address");
        require(_poolFee > 0, "Invalid pool fee");

        address poolAddress = IUniswapV3Factory(_uniswapV3FactoryAddress).getPool(address(this), _usdtAddress, _poolFee);
        require(poolAddress != address(0), "Uniswap V3 pool does not exist");

        (uint160 sqrtPriceX96,,,,,,) = IUniswapV3Pool(poolAddress).slot0();
        uint256 currentPrice = _calculatePrice(sqrtPriceX96);
        uint256 floorPrice = _calculateFloorPrice();


        if (currentPrice < floorPrice) {
            uint256 buybackAmount = _calculateBuybackAmount(currentPrice, floorPrice);
            if (buybackAmount > 0) {
                swapToToken(buybackAmount);
                Swap(buybackAmount,_usdtAddress,address(this));
                emit Buyback(msg.sender, buybackAmount);
            }
        }
    }

    function swapToToken(uint256 usdtAmount) internal nonReentrant {
        IERC20(_usdtAddress).safeIncreaseAllowance(_swapRouterAddress, usdtAmount);

        ISwapRouter(_swapRouterAddress).exactInputSingle(
            ISwapRouter.ExactInputSingleParams({
                tokenIn: _usdtAddress,
                tokenOut: address(this),
                fee: _poolFee,
                recipient: address(this),
                deadline: block.timestamp + 600,
                amountIn: usdtAmount,
                amountOutMinimum: 0,
                sqrtPriceLimitX96: 0
            })
        );
    }
    function _calculatePrice(uint160 sqrtPriceX96) internal  pure  returns(uint256) {
        // Price of 1 wei of token0 in terms of token1
        return (uint256(sqrtPriceX96) * uint256(sqrtPriceX96) * 1e18) >> (96 * 2);
    }

    function _calculateFloorPrice() internal view returns (uint256) {
        // The floor price is calculated as the USDT balance of the contract converted to token value divided by the total supply
        uint256 usdtBalance = IERC20(_usdtAddress).balanceOf(address(this));
        return (usdtBalance * 1e18) / totalSupply(); // Assuming USDT has 6 decimals
    }

    function _calculateBuybackAmount(uint256 currentPrice, uint256 floorPrice) internal view returns (uint256) {
        // Calculate the USDT amount needed to buy back enough tokens to reach the floor price
        uint256 usdtBalance = IERC20(_usdtAddress).balanceOf(address(this));

        // Ensure there's enough USDT for the buyback
        if (usdtBalance == 0) {
            return 0;
        }

        // Calculate the amount of tokens that the current USDT balance can buy at the current price
        uint256 tokensAtCurrentPrice = (usdtBalance * 1e18) / currentPrice;

        // Calculate the amount of tokens that the USDT balance should be able to buy at the floor price
        uint256 tokensAtFloorPrice = (usdtBalance * 1e18) / floorPrice;

        // The buyback amount is the difference needed to reach the floor price
        if (tokensAtCurrentPrice < tokensAtFloorPrice) {
            return tokensAtFloorPrice - tokensAtCurrentPrice;
        } else {
            return 0;
        }
    }
}"]

["class DatalogEngine {
  constructor() {
    this.facts = {};
    this.rules = {};
    this.resultsCache = {};
  }

  addFact(predicate, ...args) {
    if (!this.facts[predicate]) {
      this.facts[predicate] = [];
    }
    this.facts[predicate].push(args);
  }

  addRule(headPredicate, headArgs, body) {
    if (!this.rules[headPredicate]) {
      this.rules[headPredicate] = [];
    }
    this.rules[headPredicate].push({ headArgs, body });
  }

  query(queryPredicate, ...queryArgs) {
    const cacheKey = JSON.stringify([queryPredicate, queryArgs]);
    if (this.resultsCache[cacheKey]) {
      return this.resultsCache[cacheKey];
    }

    let results = [];

    // Apply rules iteratively until no more changes
    let changed = true;
    while (changed) {
      changed = false;

      // Use a stack to process rules
      const ruleStack = [...(this.rules[queryPredicate] || [])];
      while (ruleStack.length) {
        const { headArgs, body } = ruleStack.pop();
        for (let substitution of this.evaluateRule(body, {})) {
          // Apply the substitution to the head arguments of the rule
          const newResult = this.applySubstitution(substitution, headArgs);
          // If the result matches the query args (after applying the substitution), add it to the results
          if (this.unify(queryArgs, newResult)) {
            if (
              !results.find(
                (result) =>
                  JSON.stringify(result) === JSON.stringify(newResult),
              )
            ) {
              results.push(newResult);
              changed = true;
            }
          }
        }
      }
    }

    // Deduplicate results
    results = Array.from(new Set(results.map(JSON.stringify))).map(JSON.parse);
    this.resultsCache[cacheKey] = results;
    return results;
  }

  unify(args1, args2, substitution = {}) {
    // Check if the arguments match
    for (let i = 0; i < args1.length; i++) {
      const arg1 = args1[i];
      const arg2 = args2[i];
      if (typeof arg1 === "string" && arg1.startsWith("?")) {
        // arg1 is a variable
        if (arg1 in substitution) {
          // Variable is already assigned, check if it matches with arg2
          if (substitution[arg1] !== arg2) {
            return null;
          }
        } else {
          // Assign the variable
          substitution[arg1] = arg2;
        }
      } else if (typeof arg2 === "string" && arg2.startsWith("?")) {
        // arg2 is a variable
        if (arg2 in substitution) {
          // Variable is already assigned, check if it matches with arg1
          if (substitution[arg2] !== arg1) {
            return null;
          }
        } else {
          // Assign the variable
          substitution[arg2] = arg1;
        }
      } else if (arg1 !== arg2) {
        // Both arguments are constants and they don't match
        return null;
      }
    }
    return substitution;
  }

  applySubstitution(substitution, args) {
    return args.map((arg) => substitution[arg] || arg);
  }

  evaluateRule(body, initialSubstitution) {
    if (body.length === 0) {
      return [initialSubstitution];
    }

    const [firstClause, ...restClauses] = body;
    const [predicate, ...clauseArgs] = firstClause;
    let newSubstitutions = [];

    if (predicate === "neg") {
      const [negatedPredicate, ...negatedArgs] = clauseArgs.flat();
      if (this.rules[negatedPredicate]) {
        for (let rule of this.rules[negatedPredicate]) {
          const { headArgs, body } = rule;
          const factSubstitutions = this.evaluateRule(
            body,
            initialSubstitution,
          );
          if (!factSubstitutions.some((substitution) => substitution)) {
            // All facts failed, so the negation succeeds
            newSubstitutions.push(initialSubstitution);
          }
        }
      } else {
        const facts = this.facts[negatedPredicate] || [];
        const factSubstitutions = facts.map((factArgs) =>
          this.unify(negatedArgs, factArgs, { ...initialSubstitution }),
        );
        if (!factSubstitutions.some((substitution) => substitution)) {
          // All facts failed, so the negation succeeds
          newSubstitutions.push(initialSubstitution);
        }
      }
    } else if (predicate in this.rules) {
      for (let rule of this.rules[predicate]) {
        const { headArgs, body } = rule;
        for (let substitution of this.evaluateRule(body, initialSubstitution)) {
          // const newResult = this.applySubstitution(substitution, headArgs);
          for (let sub of this.evaluateRule(restClauses, substitution)) {
            newSubstitutions.push(sub);
          }
        }
      }
    } else {
      const substitutedArgs = this.applySubstitution(
        initialSubstitution,
        clauseArgs,
      );
      const facts = this.facts[predicate] || [];
      for (let factArgs of facts) {
        const substitution = this.unify(substitutedArgs, factArgs, {
          ...initialSubstitution,
        });
        if (substitution) {
          for (let sub of this.evaluateRule(restClauses, substitution)) {
            newSubstitutions.push(sub);
          }
        }
      }
    }

    return newSubstitutions;
  }
}

