    nvcuda::wmma::fragment<nvcuda::wmma::matrix_b, 16, 16, 16, half, nvcuda::wmma::col_major> bFrag;
    nvcuda::wmma::fragment<nvcuda::wmma::accumulator, 16, 16, 16, half> cFrag;
    nvcuda::wmma::fill_fragment(cFrag, 0.0f);

    for (unsigned k = 0; k < K; k += TILE_K)
    {
      auto const ik = threadIdx.x % TILE_K;
      auto const imo = threadIdx.x / TILE_K;
      if (k > 0) __syncthreads();

      for (unsigned i = 0; i < TILE_M * TILE_K; i += threadsInBlock) {
        auto const in = i / TILE_K;
        aCache[i + threadIdx.x] = a[K * (imo + in + blockM) + ik + k];
